// ============================================
// PARSE GEMINI UGC SCRIPT ‚Üí CREATE SORA 2 PAYLOAD
// ============================================

const item = $input.first();

console.log('üé¨ Processing Sora 2 video generation request...');

// ============================================
// 1. EXTRACT GEMINI UGC SCRIPT (from Analyze an image)
// ============================================

let videoScript = '';

try {
  // Extract from Analyze an image node response
  videoScript = item.json.content?.parts?.[0]?.text || item.json.text || '';

  // Clean any markdown
  videoScript = videoScript
    .replace(/```\n?/g, '')
    .trim();

  if (!videoScript) {
    throw new Error('No video script found in Analyze an image response');
  }

  console.log(`‚úÖ Video script extracted: ${videoScript.length} chars`);
  console.log(`   Preview: ${videoScript.substring(0, 100)}...`);

} catch (e) {
  console.error('‚ùå Script extraction failed:', e.message);
  throw new Error('Could not extract video script from Analyze an image: ' + e.message);
}

// ============================================
// 2. GET UPLOADED IMAGE URL (from either KieUpload node)
// ============================================

let uploadedImageUrl = '';
let imageSource = '';

try {
  // Try KieUpload_Edited first (if human was detected and removed)
  const editedUploads = $('KieUpload_Edited').all();

  if (editedUploads && editedUploads.length > 0) {
    uploadedImageUrl = editedUploads[0].json.data?.downloadUrl;
    imageSource = 'KieUpload_Edited (human removed)';
    console.log('‚úÖ Using EDITED image from KieUpload_Edited');
  }

} catch (e) {
  console.log('‚ö†Ô∏è KieUpload_Edited not found or empty, trying KieUpload_Original...');
}

// If edited not found, try original (if no human was detected)
if (!uploadedImageUrl) {
  try {
    const originalUploads = $('KieUpload_Original').all();

    if (originalUploads && originalUploads.length > 0) {
      uploadedImageUrl = originalUploads[0].json.data?.downloadUrl;
      imageSource = 'KieUpload_Original (no human in original)';
      console.log('‚úÖ Using ORIGINAL image from KieUpload_Original');
    }

  } catch (e) {
    console.log('‚ö†Ô∏è KieUpload_Original not found either');
  }
}

// Final validation
if (!uploadedImageUrl) {
  console.error('‚ùå Could not find uploaded image URL from any KieUpload node');
  console.error('Please verify:');
  console.error('  1. Either KieUpload_Edited or KieUpload_Original executed successfully');
  console.error('  2. The upload response contains data.downloadUrl');
  console.error('  3. The workflow flow reached one of the upload nodes');
  throw new Error('Uploaded image URL not found. Check KieUpload nodes execution and output.');
}

console.log(`üì¶ Image URL retrieved: ${uploadedImageUrl}`);
console.log(`   Source: ${imageSource}`);

// ============================================
// 3. GET PRODUCT DATA FROM TRIGGER
// ============================================

let productData;
try {
  productData = $('When Executed by Another Workflow').first().json;
  console.log('‚úÖ Product data retrieved from trigger');
  console.log(`   Listing ID: ${productData.listing_id}`);
  console.log(`   Title: ${productData.new_title?.substring(0, 50)}...`);
} catch (e) {
  console.warn('‚ö†Ô∏è Could not access product data from trigger');
  productData = {
    listing_id: 'unknown',
    new_title: 'Unknown Product',
    product_title: 'Unknown Product'
  };
}

// ============================================
// 4. BUILD SORA 2 API PAYLOAD
// ============================================

const sora2Payload = {
  model: "sora-2-image-to-video",
  input: {
    prompt: videoScript,
    image_urls: [uploadedImageUrl],  // ‚úÖ IMAGE FROM KIEUPLOAD (EDITED OR ORIGINAL)
    aspect_ratio: "landscape",
    n_frames: "10",
    remove_watermark: true
  }
};

console.log('');
console.log('üì¶ ========================================');
console.log('   SORA 2 PAYLOAD CREATED');
console.log('========================================');
console.log('   Model:', sora2Payload.model);
console.log('   Prompt length:', videoScript.length, 'chars');
console.log('   Image URL:', uploadedImageUrl);
console.log('   Image source:', imageSource);
console.log('   Aspect ratio:', sora2Payload.input.aspect_ratio);
console.log('   Duration:', sora2Payload.input.n_frames, 'seconds');
console.log('   Remove watermark:', sora2Payload.input.remove_watermark);
console.log('========================================');
console.log('');

// ============================================
// 5. RETURN STRUCTURED OUTPUT FOR SORA 2 API
// ============================================

return {
  json: {
    // ===== SORA 2 API PAYLOAD (for HTTP Request node) =====
    model: sora2Payload.model,
    input: sora2Payload.input,

    // ===== METADATA (for tracking and debugging) =====
    listing_id: productData.listing_id,
    product_title: productData.new_title || productData.product_title,
    video_script: videoScript,
    video_script_preview: videoScript.substring(0, 200) + '...',
    hero_image_original: productData.generated_image_1,
    hero_image_uploaded: uploadedImageUrl,
    image_source: imageSource,

    // ===== VIDEO CONFIG =====
    video_duration: '10s',
    video_format: 'landscape',
    video_provider: 'sora-2',

    // ===== STATUS FLAGS =====
    payload_ready: true,
    has_script: !!videoScript,
    has_image: !!uploadedImageUrl,

    // ===== TIMESTAMP =====
    processed_at: new Date().toISOString(),
    workflow_stage: 'sora2_payload_ready'
  }
};

// ============================================
// RESTORE BINARY + PARSE DETECTION RESULT
// ============================================

const downloadImageItem = $('DownloadImage1').first();
const humanDetectorItem = $('HumanDetector1').first();

// Parse detection result
const detectionText = humanDetectorItem.json.content?.parts?.[0]?.text || '';
const humanDetected = detectionText.trim().toUpperCase() === 'YES';

// Get binary data
const binaryData = downloadImageItem.binary;

if (!binaryData || !binaryData.data) {
  throw new Error('‚ùå No binary data found');
}

console.log(`üîç Human detected: ${humanDetected ? 'YES' : 'NO'}`);
console.log(`üì¶ Binary restored: ${binaryData.data.mimeType}`);

// Return JSON + Binary
return {
  json: {
    human_detected: humanDetected,
    detection_text: detectionText.trim(),
    listing_id: downloadImageItem.json.listing_id || 'unknown'
  },
  binary: binaryData  // ‚Üê BINARY BURADA
};

// ============================================
// PARSE SORA 2 VIDEO RESULT
// ============================================

const item = $input.first();

console.log('üì• Parsing Sora 2 video result...');

// ============================================
// 1. VALIDATE API RESPONSE
// ============================================

if (item.json.code !== 200 || item.json.msg !== 'success') {
  console.error('‚ùå API Error:', item.json);
  throw new Error(`Sora 2 generation failed: ${item.json.msg || 'Unknown error'}`);
}

const data = item.json.data;

console.log(`   Task ID: ${data.taskId}`);
console.log(`   Model: ${data.model}`);
console.log(`   State: ${data.state}`);

// ============================================
// 2. CHECK TASK STATE
// ============================================

if (data.state === 'fail') {
  console.error('‚ùå Task failed:', data.failMsg);
  throw new Error(`Task failed: ${data.failCode} - ${data.failMsg}`);
}

if (data.state === 'waiting') {
  console.warn('‚è≥ Task still waiting, need to retry...');
  throw new Error('Task not ready yet, retry needed');
}

if (data.state !== 'success') {
  console.error('‚ùå Unknown task state:', data.state);
  throw new Error(`Unknown task state: ${data.state}`);
}

// ============================================
// 3. PARSE RESULT JSON & EXTRACT VIDEO URL
// ============================================

let resultData;
try {
  resultData = JSON.parse(data.resultJson);
} catch (error) {
  console.error('‚ùå Failed to parse resultJson:', error);
  throw new Error('Invalid resultJson format');
}

// Extract video URL
const videoUrl = resultData.resultUrls?.[0];

if (!videoUrl) {
  console.error('‚ùå No video URL found in response');
  throw new Error('No generated video URL');
}

console.log('‚úÖ Video generated successfully!');
console.log(`   Video URL: ${videoUrl}`);
console.log(`   Generation time: ${data.costTime}s`);

// ============================================
// 4. GET ORIGINAL PRODUCT DATA
// ============================================

let productData = {};
try {
  productData = $('When Executed by Another Workflow').first().json;
} catch (e) {
  console.warn('‚ö†Ô∏è Could not access product data');
}

// ============================================
// 5. RETURN STRUCTURED VIDEO DATA
// ============================================

return {
  json: {
    // ===== VIDEO URLS =====
    video_url: videoUrl,
    video_thumbnail: videoUrl.replace('.mp4', '_thumbnail.jpg'),

    // ===== PRODUCT METADATA =====
    listing_id: productData.listing_id || 'unknown',
    product_title: productData.new_title || productData.product_title || '',

    // ===== GENERATION INFO =====
    task_id: data.taskId,
    model: data.model,
    generation_time_seconds: data.costTime,
    api_state: data.state,

    // ===== VIDEO CONFIG =====
    video_duration: '10s',
    video_format: 'landscape',
    video_provider: 'sora-2',

    // ===== STATUS =====
    pinterest_ready: true,
    etsy_ready: true,
    watermark_removed: true,

    // ===== TIMESTAMPS =====
    generated_at: new Date(data.completeTime).toISOString(),
    created_at: new Date(data.createTime).toISOString(),

    // ===== WORKFLOW =====
    workflow_stage: 'video_generation_complete',
    branch: 'video'
  }
};

// ============================================
// CHECK FAILURE TYPE (waiting vs guardrail fail)
// ============================================

const response = $input.first().json;
const data = response.data;
const state = data.state;

console.log('üîç Analyzing failure type...');
console.log(`   State: ${state}`);

// ============================================
// CASE 1: STILL WAITING (normal retry)
// ============================================
if (state === 'waiting') {
  console.log('‚è≥ Task still processing, will retry after wait...');

  return [{
    json: {
      ...data,
      route: 'wait_retry',
      retry_type: 'normal',
      needs_regeneration: false
    }
  }];
}

// ============================================
// CASE 2: FAILED (check if guardrail)
// ============================================
if (state === 'fail') {
  const failCode = data.failCode;
  const failMsg = data.failMsg || '';

  console.log('‚ùå Task failed');
  console.log(`   Fail code: ${failCode}`);
  console.log(`   Fail message: ${failMsg}`);

  // Check for guardrail violation keywords
  const isGuardrailViolation = 
    failMsg.toLowerCase().includes('guardrail') ||
    failMsg.toLowerCase().includes('third-party content') ||
    failMsg.toLowerCase().includes('violate') ||
    failMsg.toLowerCase().includes('policy') ||
    failMsg.toLowerCase().includes('copyright') ||
    failCode === '400';

  if (isGuardrailViolation) {
    console.log('üö® GUARDRAIL VIOLATION DETECTED');
    console.log('   Will regenerate prompt to remove copyrighted content');

    // Extract original prompt from param
    let originalPrompt = '';
    let originalImageUrls = [];

    try {
      const param = JSON.parse(data.param);
      const input = JSON.parse(param.input);
      originalPrompt = input.prompt || '';
      originalImageUrls = input.image_urls || [];
    } catch (e) {
      console.error('‚ö†Ô∏è Could not parse original prompt from param');
    }

    return [{
      json: {
        ...data,
        route: 'regenerate_prompt',
        retry_type: 'guardrail',
        needs_regeneration: true,

        // Pass data for regeneration
        original_prompt: originalPrompt,
        original_image_urls: originalImageUrls,
        fail_reason: failMsg,
        fail_code: failCode
      }
    }];

  } else {
    // Other failure (not guardrail) - fatal error
    console.error('üíÄ Non-recoverable failure');
    console.error(`   Stopping workflow`);

    return [{
      json: {
        ...data,
        route: 'fatal_error',
        retry_type: 'none',
        needs_regeneration: false,
        error_message: `Task failed: ${failCode} - ${failMsg}`
      }
    }];
  }
}

// Unknown state
console.error('‚ùì Unknown state:', state);
throw new Error(`Unknown task state: ${state}`);

// ============================================
// BUILD RETRY PAYLOAD WITH REGENERATED PROMPT
// ============================================

const regeneratedItem = $input.first();
const checkFailureItem = $('CheckFailureType1').first();
const triggerData = $('When Executed by Another Workflow').first().json;

// Extract regenerated prompt
const newPrompt = regeneratedItem.json.content?.parts?.[0]?.text || 
                  regeneratedItem.json.text || '';

// Get original image URLs
const imageUrls = checkFailureItem.json.original_image_urls || [];

if (!newPrompt) {
  throw new Error('‚ùå Failed to extract regenerated prompt from Gemini');
}

if (imageUrls.length === 0) {
  throw new Error('‚ùå No image URLs found for retry');
}

console.log('üîÑ Building retry payload...');
console.log(`   New prompt length: ${newPrompt.length} chars`);
console.log(`   Image URL: ${imageUrls[0]}`);

// Build Sora 2 payload
const retryPayload = {
  model: "sora-2-image-to-video",
  input: {
    prompt: newPrompt,
    image_urls: imageUrls,
    aspect_ratio: "landscape",
    n_frames: "10",
    remove_watermark: true
  }
};

console.log('‚úÖ Retry payload ready');

return {
  json: {
    model: retryPayload.model,
    input: retryPayload.input,

    // Metadata
    listing_id: triggerData.listing_id,
    product_title: triggerData.new_title || triggerData.product_title,
    retry_attempt: true,
    retry_reason: 'guardrail_violation_fixed',
    regenerated: true,
    processed_at: new Date().toISOString()
  }
};
